import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
export function Routes(){
    return(
    <div>
        <Switch>
        <Route path={`${match.path}/:topicId`}>
          <Topic />
        </Route>
        <Route path={match.path}>
          <h3>Please select a topic.</h3>
        </Route>
      </Switch>
    </div>)
}
